import React, { Fragment, useEffect, useState } from 'react';
import axios from 'axios';

const SubAdminId = ({ match }) => {
  const [subAdmin, setSubAdmin] = useState({});

  useEffect(() => {
    async function loadSubAdmin() {
      console.log(match.params.id);
      try {
        const res = await axios.get(`/api/admin/subAdmin/${match.params.id}`);
        setSubAdmin(res.data);
      } catch (err) {
        console.log(err.message);
      }
    }
    loadSubAdmin();
  }, []);

  return (
    <Fragment>
      <div className='container , main'>
        <div className='row'>
          <div className='col-3'></div>
          <div className='col-3'>
            <label htmlFor='ava-e' className='stylemera'>
              Name
            </label>
          </div>
          <div className='col-3 , stylemera'>{subAdmin.name}</div>
          <div className='col-3'></div>
        </div>

        <div className='row'>
          <div className='col-3'></div>
          <div className='col-3'>
            <label htmlFor='ava-e' className='stylemera'>
              Name{' '}
            </label>
          </div>
          <div className='col-3 , stylemera'>{subAdmin.name}</div>
          <div className='col-3'></div>
        </div>
        <div className='row'>
          <div className='col-3'></div>
          <div className='col-3'>
            <label htmlFor='ava-e' className='stylemera'>
              Name{' '}
            </label>
          </div>
          <div className='col-3 , stylemera'>{subAdmin.name}</div>
          <div className='col-3'></div>
        </div>
        <div className='row'>
          <div className='col-3'></div>
          <div className='col-3'>
            <label htmlFor='ava-e' className='stylemera'>
              Name{' '}
            </label>
          </div>
          <div className='col-3 , stylemera'>{subAdmin.name}</div>
          <div className='col-3'></div>
        </div>
        <div className='row'>
          <div className='col-3'></div>
          <div className='col-3'>
            <label htmlFor='ava-e' className='stylemera'>
              Name{' '}
            </label>
          </div>
          <div className='col-3 , stylemera'>{subAdmin.name}</div>
          <div className='col-3'></div>
        </div>
        <div className='row'>
          <div className='col-3'></div>
          <div className='col-3'>
            <label htmlFor='ava-e' className='stylemera'>
              Name{' '}
            </label>
          </div>
          <div className='col-3 , stylemera'>{subAdmin.name}</div>
          <div className='col-3'></div>
        </div>
      </div>
    </Fragment>
  );
};

export default SubAdminId;
